/*
 * reorder
 * -------
 * Created by Lief Esbenshade
 * Last update 10/14/2019
 *
 * script is exact copy paste from: https://support.sisense.com/hc/en-us/community/posts/221227988-Manually-Order-a-Column-Chart
 *
 * This script reorders bars or pie slices into a custom order. 
 * 
 * !!! IMPORTANT !!! The reorder script reorders the categories  and/or the 
 * break-by field. The top of the script has to have the order specification for
 * both. If youre only re-ordering one then the other needs to be listed as an 
 * empty array (note script currently has `var breakby = [];`)
 * 
 *
 * To use, specify the desired order array (categories or breakby). You must spell names exactly. 
 * Copy paste into widget script. 
 * 
 * TODO: 
 * test how this interacts with labelRename or dimSwitcher.
 */


var categories= ['August', 'September', 'October', 'November', 'December', 'January', 
'February', 'March', 'April', 'May', 'June', 'July'];
var breakBy = [];


// ---------- DO NOT EDIT BELOW THIS LINE ----------

var stubbedBlankcat = {y: null, color: null, selected: false}; 
var findIndex = function(val, list) {
	if (list=='breakby') { 
		return breakBy.indexOf(val) 
	} else if (list=='categories') { 
		return categories.indexOf(val)
	}
};

widget.on('processresult',function(se,ev){
	//determine if we should sort categories or breakbys
	categoryStatus=false;
	breakStatus=false;

	for (p=0; p<ev.widget.metadata.panels.length; p++){
		if (ev.widget.metadata.panels[p].name=="categories" && ev.widget.metadata.panels[p].items.length>0 && categories.length>0){
			categoryStatus=true;
		}
		else if (ev.widget.metadata.panels[p].name=="break by" && ev.widget.metadata.panels[p].items.length>0 && breakBy.length>0){
			breakStatus=true;
		}
	};

	if (categoryStatus){
		ev.result.series.forEach( function(bb) {
			newData= new Array(categories.length);
			var blankcat;
			bb.data.forEach( function(cat) {
				if (typeof cat.selectionData !== 'undefined'){
					newData[findIndex(cat.selectionData[0].trim(), 'categories')]=cat;
				}
				else{
					blankcat=cat;	
				}
			})
			for (i=0; i<newData.length; i++) {
				if (typeof newData[i] === 'undefined') {
					newData[i]=blankcat || stubbedBlankcat;	
				}
			}
			bb.data=newData;
		});
		ev.result.xAxis.categories=categories;
	};

	if (breakStatus) {
		ev.result.series.sort(function(a,b){
			if (findIndex(a.name, 'breakby') < findIndex(b.name,'breakby')) {
				return -1
			} else if (findIndex(a.name,'breakby') > findIndex(b.name,'breakby')) {
				return 1
			}
			return 0;
		});
	};
});

